Met: Jan Decleir, Betty Schuurman, Anneke Blok, Mamoun Elyounoussi, Ebbie Tam, Antoin Cox 

Winky Wong is zes jaar als ze met haar moeder vanuit China verhuist naar Nederland, waar haar vader een restaurantje runt. Alles is hier anders en Winky moet wennen aan de mensen, de taal en de gewoontes. De eerste schooldag is een ramp en ze wil er nooit meer heen. Ze vind troost bij Saartje, een oude pony. Winky vindt paarden lief en wil zelf ook een paard. Dan hoort Winky op school over de komst van Sinterklaas, een hele lieve man die iedereen cadeautjes geeft. Winky krijgt een ontzettend goed idee. Ze vraagt gewoon een paard aan Sinterklaas. Dan komt alles vanzelf goed. Of niet? 

